import React, {Component} from "react";
import './Navbar.css'

class Navbar extends Component {
    render(){
        return (
            <div>
            <nav className="nav">
                <h3 className="heading">MyPortfolio</h3>
                <ul>
                    <li>
                         <a>About Me </a>
                    </li>
                        <a>Services</a>
                    <li>
                        <a>Portfolio</a>
                    </li>

                    <li>
                        <a>Skillset</a>
                    </li>

                    <li>
                        <a>Contact Me</a>
                    </li>
                </ul>
            </nav>
            </div>
        );
    }
}
export default Navbar;
